import{_ as e,o as a,c as t,e as r}from"./app.acfc35a6.js";const c={},n=r('<h1 id="_2-常见的状态码" tabindex="-1"><a class="header-anchor" href="#_2-常见的状态码" aria-hidden="true">#</a> 2. 常见的状态码</h1><h2 id="正文" tabindex="-1"><a class="header-anchor" href="#正文" aria-hidden="true">#</a> 正文：</h2><p>常见的状态码：</p><p>1xx - 服务器收到请求。 2xx - 请求成功，如 200。 3xx - 重定向，如 302。 4xx - 客户端错误，如 404。 5xx - 服务端错误，如 500。</p><h2 id="具体的状态码" tabindex="-1"><a class="header-anchor" href="#具体的状态码" aria-hidden="true">#</a> 具体的状态码：</h2><p>200 - 成功。 301 - 永久重定向（配合 location，浏览器自动处理）。 302 - 临时重定向（配合 location，浏览器自动处理）。 304 - 资源未被修改。 401 - 没权限。 403 - 资源不可用，执行访问被禁止。 404 - 资源未找到。 405 - 请求方法（GET、POST 等）对指定的资源不适用 500 - 服务器错误。 504 - 网关超时。</p>',6),h=[n];function o(_,d){return a(),t("div",null,h)}const s=e(c,[["render",o],["__file","2.状态码.html.vue"]]);export{s as default};
